(1580642000, 'منزل للايجار فى الدقى', 'منزل للايجار فى الدقى', 'منزل من المالك مباشرة مسجل وخالى من السكان اول نمرة بحارة فى الالف مسكن من شارع ادم قريب من احمد عصمت مكون من ارضى ودورين تشطيب لوكس والدور شقة واحدة حوائط حاملة وكامل المرافق كهرباء ومياة وغاز وسقف معزول مبلط سيراميك', NULL, '31.204986982047558', '30.0387554738768', '01156632698', '200', '8000', NULL, '3', '3', '1', NULL, NULL, 'active', 1, 1, 'rent', 'cash', 'pending', 'owner', 'super_lux', 2, 1, 2, 47, '2020-01-02 07:00:00', '2020-03-11 18:37:37', 16000000, 1),
(1580644324, 'فيلا للبيع فى الشيخ زايد', 'فيلا للبيع فى الشيخ زايد', 'توين هاوس مميز جدا تشطيبات خاصة للبيع \r\n\r\nمساحة الارض : 340 متر\r\nمساحة المباني : 310 متر\r\n\r\n3 غرف نوم\r\n3 حمام\r\n\r\nتشطيب الترا سوبر لوكس بالتكييفات', NULL, '30.97428964426829', '30.048328420799336', '01156632698', '650', '13000', NULL, '10', '12', '1', NULL, NULL, 'active', 0, 1, 'sale', 'cash', 'accepted', 'owner', 'extra_super_lux', 6, 2, 2, 51, '2019-12-02 20:56:01', '2020-02-12 22:28:57', 8450000, 1),
(1580644565, 'دوبلكس للبيع الرحاب', 'دوبلكس للبيع الرحاب', 'AMAZING corner for sale \r\n287 m\r\n3 bedrooms\r\n3 bathrooms\r\nReception\r\nLiving\r\nMaids room +toilet\r\nLavable phase\r\nView lake', NULL, '31.473476460348284', '30.056595808135775', '01156632698', '287', '12000', NULL, '3', '3', '1', NULL, NULL, 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'super_lux', 7, 2, 1, 3, '2019-10-02 20:00:47', '2020-09-05 16:42:16', 3444000, 1),
(1580644852, 'منزل للبيع فى  القاهره الجديده', 'منزل للبيع فى  القاهره الجديده', 'فيفث سكوير المراسم هو من أفخم المشاريع السكنية الواقعة في قلب القاهرة الجديدة بالتجمع الخامس. يحمل المشروع اسم له كيانه في الأسواق العقارية وهى شركة المراسم السعودية والتي تُعد من أفضل الشركات ذات السمعة الطيبة، حيث اكتسبت الشركة ثقة عُملائها من خلال تلك المشاريع الناجحة والمُبتكرة والتي تم تصميمها بأحدث التصميمات العالمية، والتي تمنحك العيش بأفخم الكمبوندات العالمية على أراضي مصرية.\r\n\r\n- حيث يقع المشروع في الجولدن سكوير، أو مايسمى بالمربع الذهبي والذي يعد من أروع مناطق التجمع الخامس وأكثرها حيوية.\r\nحيث يطل المربع الذهبي على شارع التسعين الشمالي وهو من أهم الشوارع حيوية بالقاهرة الجديدة وأكثرها اتساعًا.\r\n- حيث يقع كمبوند فيفث سكوير التجمع الخامس بالتحديد في تلك التوسعات المتواجدة بين أهم المشاريع السكنية بالتجمع الخامس.\r\nوالتي من ضمنها كمبوند بادية بالم هيلز و فيلدج جاردنز القطامية، كما أن المشروع يقع بجوار فيلات الشربتلي وأعمار و مافيدا.\r\nومن هنا يتضح لنا أن موقع فيفث سكوير المراسم مميز للغاية يقع بجوار العديد من الأبنية الحيوية الموجودة في القاهرة الجديدة.\r\n- حيث يقع الكمبوند على بعد 5 دقائق من الجامعة الأمريكية، كما أنه قريب جدا من حي مصر الجديدة.\r\nفأنت في غضون 10 دقائق فقط تجد نفسك في قلب مصر الجديدة،\r\nومن أبرز المميزات كذلك أنه يفصل بينه وبين وسط القاهرة الكبرى حوالي ثلث ساعة فقط بالسيارة.\r\n\r\n- خدمات المشروع\r\n• نادي صحي مجهز على أعلى مستوى ويضم أحدث الأجهزة الرياضية.\r\n• منطقة ضخمة المساحة مخصصة للمطاعم والكافيهات والتي تقدم مأكولات ومشروبات عالمية.\r\n• جيم وسبا وساونا.\r\n• مساحات خضراء واسعة تمنح الوحدات فيو رائع تجعلها في تناغم مع ألوان الطبيعة الجذابة.\r\n• مسارات وتراكات تتخلل تلك المساحات الخضراء للتريض وركوب الدراجات.\r\n• خدمة استقبال على أعلى مستوى لزوار فيفث سكوير المراسم.\r\n• كلوب هاوس مخصص لمنطقة الشقق، وآخر مخصص للفيلات.\r\n• بحيرات صناعية ذات مياه نقية كرستالية.\r\n• منطقة تجارية ضخمة تضم العديد من المولات التجارية التي تقدم أفخم الماركات.\r\n\r\n- تسليم جميع الوحدات متشطبه بالتكييفات\r\n- مساحه الوحده 100م بجاردن 49م', NULL, '31.428941451955527', '29.998579572872497', '01156632698', '200', '13000', NULL, '6', '3', '1', NULL, NULL, 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'extra_super_lux', 2, 5, 1, 40, '2019-09-02 20:05:10', '2020-02-12 20:57:30', 18000000, 1),
