(1580825010, 'شقة للبيع في الدقي', 'شقة للبيع في الدقي', 'شقة مميزة للبيع على ميدان المساحة بجوار فندق سفير\n\n5 دقائق إلى مترو الدقي\n5 دقائق إلى كرنيش النيل وميدان الجلاء\n15 دقيقة إلى جامعة القاهرة\n20 دقيقة إلى وسط البلد\nبجوار جميع السفارات وفيو ميدان المساحة\n\nالشقة مكونة من:\n3 غرف + حمامين + مطبخ + ريسبشن فطعتين + ليفينج\nتشطيب سوبر لوكس + تجهيزات مطبخ كاملة\nونجف كرسال من كرستال عصفور ونافذة عزل إلكتروني + 5 تكييفات\nالشقة مسجلة وحصة في الأرض وتصلح تمويل عقاري\nالمساحة الاجمالية 172 متر\n\nيوجد 2 أسانسير\nلدور الخامس / السعر المطلوب : 2.350.000 قابلة للتفاوض\nملاحظة: سعر المتر في ميدان المساحة 13.500\nللتواصل : 1157891967\nالرقم متاح واتس آب', NULL, '31.214609590515277', '30.0361502058281', '01157891967', '172', '13000', NULL, '3', '2', '4', NULL, NULL, 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'extra_super_lux', 3, 10, 2, 47, '2020-02-15 23:30:18', '2020-03-11 20:24:53', 2250000, 1),
