(1580913943, 'قصر للبيع في بيفرلي هيلز الشيخ زايد 1200متر', 'قصر للبيع في بيفرلي هيلز الشيخ زايد 1200متر', 'للبيع قصر في بيفرلي هيلز بالشيخ زايد السعر قابل للتفاوض\r\nالمساحة 1200متر مباني\r\nمساحة الارض 900\r\n- الدور الارضى 350 متر عباره عن ريسبشن وليفنج وحمام ومطبخ وغرفه خزين\r\n\r\n- مساحه الحديقه 600 متر وبها حمام سباحه امريكى\r\n\r\n- الدور الاول 350 متر عباره عن ليفنج وغرفة نوم ببلكونه\r\n\r\nو3 غرف ماستر كل غرفه بها حمام ودريسنج روم\r\n\r\n- الروف 350 متر به مبانى 150 متر عباره عن غرفه وحمام وغرفه جاكوزي\r\n\r\n- الدور البدروم 320 متر به غرفه مكتب وحمام وغرفه مخزن وغرفه جاكوزي ومكان لعدد 2 سياره مجهز بمغسله وغرفه حارس وحمام ومطبخ\r\n\r\n-عدد غرف النوم 8\r\nمنهم 4 سويت حمام ودريسنج كل حاجه فى الفيلا تطل على الميدان حتى الحمامات\r\n\r\nالقصر موقعه مميز جدا علي 3 نواصى على اكبر ميدان فى بيفرلي هيلز\r\nالقصرعلى ربوه ترى حتى الحزام الاخضر\r\n\r\n- سيستم صوت للحديقه وسيستم كاميرات مراقبه وسيستم سمارت هوم التحكم فى الفيلا عن طريق التليفون\r\n\r\n- 3عداد كهرباء وعداد مياه وعداد غاز طبيعي وتليفون ونت ارضي dsl\r\n\r\n\r\n- الفيلا معزوله بالكامل حوائط واسقف عزل حراري وبها غاز\r\nطبيعي اجهزه lg وسامسونج وتكيفات شارب\r\n\r\n- فرش تركى جديد واجهزه وتحف\r\n\r\n- جاكوزى فى الروف وحمام سباحه هيورد امريكى فى الحديقه وجاكوزى سبا سخن وبارد فى البيزمنت\r\n\r\n\r\nالسعر شامل الفرش والاجهزه والتحف\r\n\r\nكمباوند بيفرلي هيلز الشيخ زايد تابع لشركه سوديك\r\n----------------------------------------------------------------------------\r\n\r\n-----------------------------------------------------------------------------\r\nلو بتدور علي شقة / فيلا / مكتب او عقار او حتي عايز تبيع كونسبت دايما هي الاختيار الانسب\r\nليه كونسبت؟\r\nلاننا بنساعدك تلاقي بيت احلامك حسب احتياجك مش بس من حيث المساحة والسعر كمان الروح اللي هتناسب شخصيتك وقرب المكان لشغلك واهلك، عندنا فريق عمل متميز يقدر يحدد احتياجاتك بالظبط سواء للاستثمار او السكن وبيرشحلك اكتر من وحده في اكتر من ١٠ كومباوند مختلفين علشان نناسب احتياجك وبيفضل معاك لحد ما تلاقي بيت احلامك وبيزودك بكل المعلومات اللي تلزمك وهيبقي ليك مزايا كتيرة زي الفيو المميز وخصومات علي قد ميزانيتك مش بس كده انت كمان لو حبيت بعد فترة تبيع وحدتك بنقدملك خدمة ال resale اللي بتقدر من خلالنا توصل لمشتري مناسب لاننا دايما جنبك\r\nهدفنا سعادتك\r\nعلشان كده احنا دايما الاقرب ليك', NULL, '30.991040915250778', '29.983784093718395', '01091093981', '1200', '30000', NULL, '8', '7', '3', NULL, NULL, 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'super_lux', 6, 18, 2, 44, '2020-02-11 00:18:42', '2020-02-12 20:25:51', 36000000, 1),
