(1583924157, 'شقة للبيع في محيط ميدان اسوان', 'شقة للبيع في محيط ميدان اسوان', 'السكني\nشقتين للبيع في شارع الدكتور المحروقي \nالمساحات الموجودة 230 متر \nالدور العاشر والدور الثاني شارع الدكتور المحروقي في محيط  ميدان اسوان ومتفرع من شارع البطل احمد عبد العزيز و5 دقائق لجامعة الدول العربية  \nالشقة مكونة من:\n3 اوض نوم + 3 حمام + ريسيبشن 3 قطع + تراس \n2 اسانسير\nمدخل شيك \nامكانية امتلاك حصة في الجراج\nسعر المتر 10.000 جنيه طور احمر\nالسعر الإجمالي 2.230.000 جنية\nالإداري\nمتوفر في العمارة مساحة 660 متر إداري كامل الدور الأول للبيع المتر 15.000 الف غير مشطب \nالإجمالي 9.900.000\n مع 90 متر متشطب 1.530.000 جنيه في الدورالثاني.\nالتجاري\nمتوفر محليين منفصلين من الواجهة متصلي من الجهة الخلفية كل محل في شارع \nالمحل في شارع الدكتور المحروقي مساحته 110 متر مطلوب في المتر بيع 33.000 المتر\n الإجمالي: 3.630.000 \nالمحل على شارع ابو الكرامات مساحته 100 مطلوب في المتر بيع 25.000 المتر   \nالإجمالي: 2.525.000\nالتشطيب طوب أحمر', NULL, '31.206613611906803', '30.05468504572929', '01157891967', '230', '11000', NULL, '3', '3', '1', NULL, NULL, 'active', 1, 1, 'sale', 'installment', 'accepted', 'owner', 'core&chel', 3, 10, 2, 47, '2020-03-11 19:50:05', '2020-03-11 19:52:57', 2500000, 1),
