(1583928358, 'شقة للبيع بفيو النيل', 'شقة للبيع بفيو النيل', 'شقة للإيجار بفيو النيل:\n----------\nلمحطة فضائية كبرى او لاحدى الشركات الكبرى\nموقع فريد ومتميز بشارع المتحف الزراعى\nتطل على النيل مربع يرى النيل بمساحة كبيرة من المنيل وببرج القاهرة وفندق سميراميس وهيلتون رمسيس و المتحف المصرى ومركز شباب الجزير\nومبنى الاذاعة والتليفزيون وابراج البنك الاهلى وتطل على كوبرى السادس من أكتوبر باكمله تقريبا\nكل هذا من اتجاه واحد. \nالشقة مكونة من:\nأربع غرف\nريسبشن 4 قطع\n2 حمام ومطبخ\nبمساحة 190متر مع وجود روف علوي\nمسجلة صحة ونفاذ وليها حصة في الأرض ويوجد روف بمساحة 45 متر حق انتفاع\n\nمطلوب للإيجار 11.500 جنيه في الشهر\nوللبيع : 1.900.000 جنيه\nوتقبل البدل في حال كان المكان مناسب', NULL, '31.214975725138096', '30.04799166003205', '01157891967', '190', '10000', NULL, '4', '2', '15', NULL, NULL, 'active', 0, 1, 'sale', 'cash', 'accepted', 'owner', 'super_lux', 3, 10, 2, 48, '2020-03-11 20:15:46', '2020-03-11 20:16:13', 1900000, 0),
