(1583928949, 'شقة في الدقي', 'شقة في الدقي', '🎯 شقة تحفة جداً ومميزة للبيع في ميدان المساحة في الدقي بجوار فندق سفير🎯 \r\n☝️دقائق الي شارع الكرنيش ☝️\r\n⛩ مدخل على الميدان ⛩\r\n👌3 دقائق الى مترو الدقي👌\r\n6 دقائق الى شارع البطل أحمد عبد العزيز\r\n15 دقيقة إلى #نادي_الصيد و #جامعة_الدول_العربية\r\n15 دقيقة إلى #جامعة_القاهرة\r\nبجوار عمارة المهندسين بإنشاء معماري متميز\r\nفيو فندق سفير \r\nالشقة مكونة من:\r\n3 غرف نوم - مكتب خاص - 2 حمام - مطبخ - ريسبشن 3 قطع - 3 تراس\r\nمن أهم ميزات الشقة ان كل غرفة تملك تراس خاص .\r\nالشقة مسجلة شهر عقاري ولها حصة في الأرض\r\n🏢 دور سادس / 3 اسانسير 🏢\r\n🏬 نظام فندقي بإمتياز 🏬\r\n👨‍✈️👨‍✈️ امن ٣ورديات عمال نظافه يوميا 👨‍✈️👨‍✈️\r\nالكهربا علي خطين فتره الانقطاع 45 ثانيه\r\nويخول علي الخط الثاني\r\nالمساحة 180 متر\r\nعمارة انشاء 1991 \r\nالمطلوب 2.520.000\r\nمتوسط سعر المتر في المنطقة 14.000 الف المتر', NULL, '31.21417623013258', '30.034698793341907', '01157891967', '180', '14000', NULL, '3', '2', '6', NULL, '1985', 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'super_lux', 3, 10, 2, 47, '2020-08-26 23:14:12', '2020-08-26 23:37:22', 2450000, 1),
