(1599047176, 'property for sale in masr elgededaشقة', 'شقة للبيع في مصر الجديدة', 'شقة رائعة للبيع بالفرش في عمر ابن الخطاب بمصر الجديدة\r\n5 دقائق من محطة ميترو هارون\r\nدقيقتين من ميدان الاسماعيلية\r\nدقائق من ميدان الجامع والمدرسة اليونانية\r\nدقائق من طريق العروبة \r\nالشقة قريبة من جميع الخدمات وفي قلب مصر الجديدة\r\nالشقة مكونة من:\r\n3 غرف من ضمنهم غرفة ماستر بحمام وغرفة ملابس + 3 حمامات + ريسيبشن 4 قطع كبار + مطبخ + بلكونة بفيو واسع \r\nمساحة الشقة 260 متر\r\nالشقة بفرش كامل وتدفئة كاملة موزعة لكل الغرف (مركزية)\r\n2 سخان موزعة على الحمامات\r\nاجهزة مطبخ كاملة واثاث كامل متكامل \r\nعمارة انشاء 2003 \r\nمدخل شيك\r\nيوجد 3 اسانسير \r\nالشقة مسجلة في الشهر العقاري ولها حصة في الارض \r\nحصة في الجراج\r\nالبيع لاغراض السفر\r\nامكانية الايجار متاحة لمدة سنة\r\nللايجار 30.000 الف شهرياً\r\nالبيع 3.700.000 جنيه مصري \r\nمتوسط سعر المتر في المنطقة :\r\n13.000 الف للمتر', NULL, '31.34297322481871', '30.08990171247089', '01157891967', '260.0', '14000.0', NULL, '3', '3', '10', '0', '2013-1-1', 'active', 1, 1, 'sale', 'cash', 'accepted', 'owner', 'extra_super_lux', 3, 10, 1, 108, '2020-09-02 20:07:47', '2020-09-02 20:13:12', 3500000, 1),
